import React from "react";
import { useSelector, useDispatch } from 'react-redux';
import { saveAuthUser } from '../../redux/resources/authResources';

const Registration = () => {

    const dispatch = useDispatch()
    const { authInfo } = useSelector((state) => state)

    useEffect(() => {
        dispatch(resetLaunchServerInfo())
        dispatch(getProviderList())
        dispatch(getProviderDetails(1))
        dispatch(getServerSizeDetails(1, 1))
    }, [dispatch]);

    return (
        <div>
            <p>Registration</p>
        </div>
    )
}

export default Registration;
